import React from 'react';
import logo from './IMG_4146.PNG';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h2 className="App-paragraph">
          Welcome to NUS Health Web!
        </h2>
        <p></p>
        <p></p>
        <p></p>
        <p></p>
        <p>
        <button className="btn btn-info btn-sm" href="baidu.com" font-color="white">Portal</button>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button className="btn btn-info btn-sm">Video</button>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button className="btn btn-info btn-sm">Poster</button>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button className="btn btn-info btn-sm">Readme</button>
        </p>
      </header>
    </div>
  );
}

export default App;
